import './index.css';
import Employee from './components/Employee';
import { useState } from 'react';

function App() {
  const [role, setRole] = useState('NULL');
  const [employees, setEmployees] = useState([
    {
      name: "Jen",
      role: "Developer",
      image: "https://images.pexels.com/photos/774909/pexels-photo-774909.jpeg"
    },
    {
      name: "Marissa",
      role: "API Engineer",
      image: "https://images.pexels.com/photos/4926674/pexels-photo-4926674.jpeg"
    },
    {
      name: "Corbo",
      role: "Designer",
      image: "https://images.pexels.com/photos/2380794/pexels-photo-2380794.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1"
    },
    {
      name: "Caleb",
      role: "Designer",
      image: "https://images.pexels.com/photos/2586823/pexels-photo-2586823.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1"
    },
    {
      name: "Anna",
      role: "Manager",
      image: "https://images.pexels.com/photos/3586798/pexels-photo-3586798.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1"
    },
    {
      name: "Jackson",
      role: "Operations",
      image: "https://images.pexels.com/photos/1933873/pexels-photo-1933873.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1"
    },
    {
      name: "Bradley",
      role: "Developer",
      image: "https://images.pexels.com/photos/3748221/pexels-photo-3748221.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1"
    }
  ]);
  const showEmployees = true;
  return (
    <div className="App">
      {showEmployees ?
        <>
          <input type="text"
            onChange={(e) => {
              console.log(e.target.value);
              setRole(e.target.value);
            }}
          />
          <div className="flex flex-wrap justify-center">
            <Employee name="Caleb" role="Intern" img="https://images.pexels.com/photos/774909/pexels-photo-774909.jpeg" />
            <Employee name="John" role={role} img="https://images.pexels.com/photos/774909/pexels-photo-774909.jpeg" />
            <Employee name="Maeve" img="https://images.pexels.com/photos/774909/pexels-photo-774909.jpeg" />
            <Employee name="Caleb" role="Intern" img="https://images.pexels.com/photos/774909/pexels-photo-774909.jpeg" />
            <Employee name="John" role={role} img="https://images.pexels.com/photos/774909/pexels-photo-774909.jpeg" />
            <Employee name="Maeve" img="https://images.pexels.com/photos/774909/pexels-photo-774909.jpeg" />
            <Employee name="Caleb" role="Intern" img="https://images.pexels.com/photos/774909/pexels-photo-774909.jpeg" />
            <Employee name="John" role={role} img="https://images.pexels.com/photos/774909/pexels-photo-774909.jpeg" />
            <Employee name="Maeve" img="https://images.pexels.com/photos/774909/pexels-photo-774909.jpeg" />
          </div>
        </>
        :
        <p>You cannot see the employees.</p>
      }
    </div>
  );
}

export default App;
